description:
Girls Night Out is back with a vengeance! Tanner, Penny and the girls take the party bus out on the town. After loading up on some cocktails, they head to a nightclub. Penny and a hot blonde get freaky at the club, but it's not until she's back in her hotel room that she goes to work on Charles. At the after-party, Savannah shows off her skills to Derrick. Then Alexis Texas &amp; Sasha get sexy in the hot tub while Angelina and Jack hit the sheets. you better grab a bottle -- it's time to pound more than some shots!


Cast: Alex Gonz, Alexis Texas, Eva Angelina, Kylie Wilde, Penny Flame, Rachel Roxxx, Sascha, Savannah Stern, Tanner Mayes

